import React, { Fragment, useEffect, useState } from 'react';
import axios from 'axios';

const SubAdminId = ({ match }) => {
  const [subAdmin, setSubAdmin] = useState({});

  useEffect(() => {
    async function loadSubAdmin() {
      console.log(match.params.id);
      try {
        const res = await axios.get(`/api/admin/subAdmin/${match.params.id}`);
        setSubAdmin(res.data);
      } catch (err) {
        console.log(err.message);
      }
    }
    loadSubAdmin();
  }, []);

  return (
    <Fragment>
      <div className='divestyle'>
        <p class='text-center'>
          <label htmlFor='ava-e'>Name : </label>
          {subAdmin.name}
        </p>
        <p class='text-center'>{subAdmin.email}</p>
        <p class='text-center'>{subAdmin.phoneNumber}</p>
        <p class='text-center'>{subAdmin.city}</p>
        <p class='text-center'>{subAdmin.address}</p>
        <p class='text-center'>{subAdmin.cnic}</p>
      </div>
      <div className='container'>
        <div className='row'>
          <div className='col-3'></div>
          <div className='col-3'>
            <label htmlFor='ava-e'>Name : </label>
          </div>
          <div className='col-3 , stylemera'>{subAdmin.name}</div>
